Say we have some list, List<String> containing a bunch of fruit and the player can choose from it. In order to do that, we can use a StringArgument and suggest it to the player using .overrideSuggestions(String[]) . However, because this only lists suggestions to the player, it does not stop the player from entering an option that isn't on the list of suggestions. Therefore, to gracefully handle this with a proper error message, we use CommandAPI.fail(String) with a meaningful error message which is displayed to the user. //Array of fruit
List<String> fruit = new ArrayList<>();
fruit.add("banana");
fruit.add("apple");
fruit.add("orange"); //Argument accepting a String, suggested with the list of fruit
LinkedHashMap<String, Argument> arguments = new LinkedHashMap<>();
arguments.put("item", new StringArgument().overrideSuggestions(fruit.toArray(new String[fruit.size()]))); //Register the command
CommandAPI.getInstance().register("getfruit", arguments, (sender, args) -> { String inputFruit = (String) args[0]; if(fruit.contains(inputFruit)) { //Do something with inputFruit } else { //The player's input is not in the list of fruit CommandAPI.fail("That fruit doesn't exist!"); }
}); Developer's Note: In general, it's a good idea to handle unexpected cases with the CommandAPI.fail() method. Most arguments used by the CommandAPI will have their own builtin failsafe system (e.g. the EntitySelectorArgument will not execute the command executor if it fails to find an entity) , so this feature is for those extra cases.

